ent-loader eapps-instagram-feed-loader\\\" eapps-link=\\\"loader\\\"></div>\\n                    </div>\\n                    <div class=\\\"eapps-instagram-feed-data-status-container\\\" eapps-link=\\\"dataStatusContainer\\\">\\n                        <div class=\\\"eapps-instagram-feed-data-status\\\" eapps-link=\\\"dataStatusItemsContainer\\\">\\n                        </div>\\n                    </div>\\n                </div>\\n            </div>\\n        </div>\\n        <div class=\\\"box resetcss box_custom\\\" id=\\\"pixel_prenewsletter\\\">\\n            <div class=\\\"container\\\">\\n                <div class=\\\"prenewsletter_thumbnail\\\">\\n                    <img src=\\\"https://pixel-shop.pl/skins/user/rwd_shoper_11/images/user/foka_big.gif\\\">\\n                </div>\\n                <div class=\\\"prenewsletter_content\\\">\\n                    <h3>Licencjonowane gadżety dla graczy, fanów filmów i seriali</h3>\\n                    <p>Pixel-Shop to istna kopalnia oryginalnych gadżetów ze świata popkultury! W naszym asortymencie znajdziesz akcesoria z gier, anime czy też związanych z celebrytami. Oferujemy także popularne repliki gadżetów filmowych, które przypomną o ulubionej ekranizacji.</p>\\n                    <p>Wybierając produkty do Pixel-Shop staramy się zapewnić naszym klientom najlepszą jakość i wachlarz możliwości; figurki kolekcjonerskie do postawienia na półkach, a także czapki, koszulki, plecaki i portfele, które będziesz mógł mieć zawsze przy sobie. </p>\\n                    <p>Z Pixel-Shopem udekorujesz mieszkanie: nadaj mu geekowego sznytu z naszymi lampkami nocnymi, lampkami do zawieszenia, plakatami, wycieraczkami. Gości zachwycisz geekową, licencjonowana ceramiką i szkłem — sprawdź kubki, dzbanki, kufle, a także talerze i puchary sprawdzonych marek.</p>\\n                    <p>Znajdziesz tu licencjonowane produkty Funko, McFarlane, NECA, Bandai, Hasbro, Paladone, Pyramide, Noble Collection oraz innych uznanych producentów. Sprawdź ich wszystkich! </p>\\n                </div>\\n            </div>\\n        </div>\\n        <div class=\\\"box\\\" id=\\\"box_newsletter\\\">\\n            <div class=\\\"boxhead\\\">\\n                <span><img src=\\\"https://pixel-shop.pl/libraries/images/1px.gif\\\" alt=\\\"\\\" class=\\\"px1\\\">Odbierz swój rabat 5%</span>\\n            </div>\\n            <div class=\\\"innerbox\\\">\\n                <h5 class=\\\"boxintro\\\">Na pierwsze zamówienie, zapisując się do naszego newslettera. Dodatkowo będziesz na czasie z nowościami i promocjami! </h5>\\n                <form action=\\\"https://pixel-shop.pl/pl/newsletter/sign\\\" method=\\\"post\\\">\\n                    <fieldset>\\n                        <input type=\\\"text\\\" name=\\\"email\\\" value=\\\"\\\" placeholder=\\\"Wpisz adres e-mail\\\" class=\\\"newsletter-input\\\">\\n                        <button type=\\\"submit\\\" class=\\\"btn btn-red\\\">\\n                            <div class=\\\"newsletter_button\\\">Zapisz się</div>\\n                        </button>\\n                    </fieldset>\\n                    <fieldset>\\n                    </fieldset>\\n                </form>\\n            </div>\\n        </div>\\n        <div class=\\\"box resetcss box_custom\\\" id=\\\"pixel_opis_b\\\">\\n            <div class=\\\"pixel_opis\\\">\\n                <h2>Gadżety to inwestycja</h2>\\n                <h3>w Pixel-Shop szukaj gadżetów limitowanych o wysokiej wartości kolekcjonerskiej!</h3>\\n                <p>Wśród asortymentu naszego sklepu internetowego znajdziesz także limitowane okazy kolekcjonerskie o unikatowej wartości, którymi wzbogacisz swoją kolekcję. Być może poszczęści Ci się i zakupione przez Ciebie produkty nabiorą z czasem na wartości, okazując się trafną inwestycją.</p>\\n                <p>Kupując w naszym sklepie dla geeków masz pewność, że wybrane przez Ciebie produkty są licencjonowane oraz wysokiej jakości, co tylko podnosi Twoje szanse na trafienie gadżetów, których wartość z upływem czasu wzrośnie.</p>\\n            </div>\\n        </div>\\n        <div class=\\\"box resetcss box_custom\\\" id=\\\"pixel_opis_c\\\">\\n            <div class=\\\"pixel_opis\\\">\\n                <div class=\\\"lewa\\\"><img src=\\\"https://pixel-shop.pl/skins/user/rwd_shoper_43/images/user/gif-foka-seo-2.gif\\\" alt=\\\"\\\"></div>\\n                <div class=\\\"prawa\\\">\\n                    <h2>Produkty nie tylko dla kolekcjonerów</h2>\\n                    <h3>kupuj gadżety dla dzieci i do szkoły</h3>\\n                    <p>W naszej ofercie znajdziesz akcesoria idealne do szkoły! Plecaki, notatniki, kołonotatniki, piórniki, długopisy, zestawy papiernicze, bidony, śniadaniówki, kalendarze, planery — to i wiele więcej przyda się dziecku podczas codziennych wyzwań w szkole.</p>\\n                    <p>Wybieraj akcesoria z kręgu zainteresowań dziecka, dzięki którym przyciągnie uwagę kolegów i koleżanek i łatwiej nawiąże nowe, trwałe znajomości oparte na ulubionych filmach, animacjach, serialach i grach.</p>\\n                    <p>Spraw, aby poczuło się pewniej w szkolnym środowisku mając przy sobie produkty, które kocha i które przypominają mu o jego ulubionych bohaterach i bohaterkach.</p>\\n                    <p>W Pixel-Shop czekają gadżety Harry Potter, Disney, Marvel, Minecraft, Pokémon, Wiedźmin, Dragon Ball i wiele więcej spośród marek, które zainteresują najmłodszych geeków.</p>\\n                </div>\\n            </div>\\n        </div>\\n        <div class=\\\"box resetcss box_custom\\\" id=\\\"pixel_opis_d\\\">\\n            <div class=\\\"pixel_opis\\\">\\n                <div class=\\\"lewa\\\">\\n                    <h2>Mangi i gadżety w jednym miejscu</h2>\\n                    <h3>oszczędzaj czas i pieniądze</h3>\\n                    <p>Kochasz mangi i anime? W Pixel-Shop znajdziesz nie tylko akcesoria związane z japońską popkulturą — zapewniamy dostęp do najgorętszych tytułów mang drukowanych w Polsce prosto od wydawców!</p>\\n                    <p>Szeroki wybór tytułów oraz stale uzupełniane stany magazynowe to coś, czym możemy się poszczycić. Dodatkowo możesz liczyć na błyskawiczną wysyłkę w 24 godziny z magazynu zlokalizowanego w Polsce, dzięki czemu Twój hiatus skończy się, zanim się na dobre rozpocznie!</p>\\n                    <p>Czytaj My Hero Academia, Naruto oraz Boruto, Tokyo Ghoul, Atak tytanów, Death Note, Full Metal Alchemist, Hanako, duch ze szkolnej toalety, Chainsaw man, Jujutsu Kaisen i inne oraz zamawiaj oficjalne produkty związane z mangami i anime w jednym miejscu, dzięki czemu zaoszczędzisz czas oraz pieniądze wydane na dostawy.</p>\\n                </div>\\n                <div class=\\\"prawa\\\"><img src=\\\"https://pixel-shop.pl/skins/user/rwd_shoper_43/images/user/seo-cat-d.webp\\\" alt=\\\"\\\"></div>\\n            </div>\\n        </div>\\n        <div class=\\\"box resetcss box_custom\\\" id=\\\"pixel_opis_e\\\">\\n            <div class=\\\"pixel_opis\\\">\\n                <div class=\\\"lewa\\\"><img src=\\\"https://pixel-shop.pl/skins/user/rwd_shoper_43/images/user/gif-prezent-seo.gif\\\" alt=\\\"\\\"></div>\\n                <div class=\\\"prawa\\\">\\n                    <h2>W Pixel-Shop szukaj pomysłów na prezent</h2>\\n                    <p>Okaż zainteresowanie i troskę bliskim wybierając dla nich prezenty związane z ich zainteresowaniami. Przebieraj wśród statuetek, figurek Funko Pop, lampek, planerów i kalendarzy oraz innych&nbsp; praktycznych gadżetów do szkoły i do domu, które wywołają uśmiech i zapadną w pamięci.</p>\\n                    <p>Skorzystaj z darmowej dostawy od 199 zł oraz darmowych zwrotów do paczkomatów InPost, dzięki którym możesz spokojnie i komfortowo robić zakupy nie martwiąc się logistyką związaną ze zwrotem nietrafionych lub zdublowanych upominków.</p>\\n                    <p>Rób zakupy w naszym sklepie Pixel-Shop i bądź świadomy, że to doceniamy! Wpadaj do nas i weź udział w progra